def kafka_topic_counter(topic, zookeeper_hosts='localhost:2181'):
    """Returns the sum of offsets for a topic. This is basically a byte counter for the topic."""
    client = KafkaClient(zookeeper_hosts=zookeeper_hosts)
    topic = client.topics[topic]
    offsets = topic.latest_available_offsets()
    return np.sum([offset.offset[0] for offset in offsets.values()])

def force_utc(t):
    if isinstance(t,pd.Timestamp):
        if t.tz:
            result = t.tz_convert('UTC')
        else:
            result =  t.tz_localize('UTC')
    else:
        result = pd.to_datetime(t, utc=True)
    if type(result) != pd.tslib.Timestamp and type(result) != pd.tslib.NaTType:
        warnings.warn('force_utc: Conversion from %s resulted in type %s' % (type(t), type(result)))
        assert False
    return result

